INSERT INTO `article` VALUES ('89', 'eka', 'Our Team', 'content', 'our-team', 'Y', 'N', '<h1>Our team</h1>\n<div class=\"featured\">\n<p class=\"featured-text\">Bain is full of smart, driven people who care a lot more about getting it done, and the relationships we build, than about proving how clever we are. Bains people truly become a valuable extension of our clients teams. As a result, our people are a primary reason our clients would recommend Bain to others.</p>\n</div>\n<div class=\"interior-content\">\n<div class=\"basichtml\">\n<p>Our \"one team\" attitude breaks down silos and helps us engage equally effectively from the C-suite to the front line. Our collaborative working style emphasizes teamwork, trust, and tolerance for diverging opinions. People tell us we are down-to-earth, approachable and fun.</p>\n<p>We have a passion for our clients true results and a pragmatic drive for action that starts Monday morning 8am and doesnt let up. We rally clients with our infectious energy, to make change stick.</p>\n<p>And we never go it alone. We support and are supported to develop our own personal results stories. We balance challenging and co-creating with our clients, building the internal capabilities required for them to create repeatable results.</p>\n<p>We work hard, but we dont take ourselves too seriously. We enjoy what we do and we laugh a lot...most often at ourselves.</p>\n<p>It feels different to work with us.</p>\n</div>\n</div>', '', 'Rabu', '2016-06-22', '17:08:20', '1466587421.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '48', '0', '', '', '', 'N'), ('90', 'eka', 'Services', 'content', 'services', 'N', 'N', '<div class=\"eColGroup eBt\">\n<div class=\"ePortfolioChapterContainer\">\n<h4><span>Trusted Partner</span></h4>\n<p><span>Ericsson Global Services has been entrusted with planning, building, running and enhancing more networks than any other company. A fact that sets us apart from the rest of the services industry is that we are the only company with the ability to build, operate and manage any network, or integrate any network technology, regardless of the equipment currently in place, anywhere in the world. </span><br><br><span>Our technology leadership, business understanding, and extensive experience with managing telecom projects make us the market leader in telecom services.</span></p>\n</div>\n</div>', '', 'Rabu', '2016-06-22', '17:08:00', '1466587567.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '49', '0', '', '', '', 'N'), ('94', 'eka', 'Cara Instal WebCam IP Android Ke PC', 'article', 'cara-instal-webcam-ip-android-ke-pc', 'Y', 'N', '<p>Halo semua, Sekarang saya akan berbagi bagaimana menggunakan ponsel Android sebagai webcam ” dengan <a title=\"aplikasi webcam android\" href=\"http://jaringankomputer.org/cara-instal-aplikasi-webcam-android/\" target=\"_blank\">aplikasi webcam android</a> agar PC anda bisa menggunakan fasilitas webcam dari android untuk video call di<a title=\"jaringan komputer\" href=\"http://jaringankomputer.org/\" target=\"_blank\"> jaringan komputer</a> dan <a title=\"Jaringan Internet | Macam-Macam  Sistem Jaringan Internet\" href=\"http://jaringankomputer.org/jaringan-internet-macam-macam-sistem-jaringan-internet-adalah/\" target=\"_blank\">jaringan internet</a></p>\n<p>Sama seperti kebanyakan ketika menggunakan desktop, pada umumnya tidak memiliki webcam dan Aplikasi Webcam, jadi tentu kebingungan ketika seseorang mengajak untuk saling berbagi webcam.</p>\n<div id=\"attachment_5150\" class=\"wp-caption aligncenter\"><img class=\"size-medium wp-image-5150\" src=\"http://jaringankomputer.org/wp-content/uploads/2014/12/Memasang-Camera-Android-ke-PC-Aplikasi-Webcam-Android-ke-PC-298x300.png\" alt=\"Memasang Camera Android ke PC Aplikasi Webcam Android ke PC\" width=\"298\" height=\"300\" data-lazy-loaded=\"true\">\n<p class=\"wp-caption-text\">Memasang Camera Android ke PC Aplikasi Webcam Android ke PC</p>\n</div>\n<p>Nah bagaimana jika Anda ingin membuat video call,  padahal tidak memiliki peralatan kamera yang terpasang pada PC? Tidak perlu khawatir karena anda memiliki Ponsel cerdas, Android Smartphone yang akan memungkinkan membuat video pada komputer dengan <strong>aplikasi webcam android</strong> dan ada banyak aplikasi online tersedia untuk menggunakan ponsel Android sebagai webcam.<br><br></p>\n<p>ikuti Langkah-langkah <span>aplikasi webcam android</span>  berikut</p>\n<ul>\n<li>Langkah 1: Pertama-tama download aplikasi <a title=\"IP Address Adalah? “Pengertian Dan Cara Cek IP Address”\" href=\"http://jaringankomputer.org/ip-address-adalah-cek-ip-address-indonesia/\" target=\"_blank\">IP</a> webcam dan install Webcam IP adaptor pada komputer Anda</li>\n<li>Langkah 2: Sekarang buka aplikasi Webcam IP yang telah terinstal pada ponsel Anda, Isikan  nama pengguna, sandi, resolusi layar dan setelan lain, sesuaikan pilihan anda sebagai cataatan: untul aplikasi ini gunakan kamera belakang untuk kualitas yang lebih baik dan buat secara default, jika mengubahnya kamera depan akan mnurunkan kualitas video.</li>\n<li>Langkah 3: Sekarang Klik <strong>start</strong><a title=\"Pengertian Server & Apa itu Proxy Server Fungsi Dan Jenisnya\" href=\"http://jaringankomputer.org/pengertian-server-apa-itu-proxy-server-fungsi-dan-jenisnya/\" target=\"_blank\"><strong> server</strong></a> kemudian lihat IP di bagian bawah layar ketika IP membuka browser</li>\n<li>Langkah 4 sekarang Install IP Webcam adaptor yang telah di download. kemudian “Masukkan alamat IP dan port “(Camera feed address)webcam yang terpasang dan berjalan pada</li>\n</ul>\n<p>Dan sekarang anda sudah dapat menggunakan Ponsel android yang terhubung ke desktop dan siap digunakan untuk video conference seperti Skype, Facebook Messenger, Yahoo! Messenger dan Anda akan melihat streaming video melalui ponsel Android anda. Terimakasih telah membaca menggunakan ponsel untuk aplikasi webcam android “</p>', '', 'Rabu', '2016-06-22', '17:28:32', '1466591312.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('93', 'eka', 'Faq', 'content', 'faq', 'N', 'N', '<p><strong>Frequently asked questions</strong> (<strong>FAQ</strong>) or <strong>Questions and Answers</strong> (<strong>Q&A</strong>), are listed questions and answers, all supposed to be commonly asked in some context, and pertaining to a particular topic. The format is commonly used on email mailing lists and other online forums, where certain common questions tend to recur.</p>\n<p>\"FAQ\" is pronounced as either an <a class=\"mw-redirect\" title=\"Initialism\" href=\"https://en.wikipedia.org/wiki/Initialism\">initialism</a> (F-A-Q) or an <a title=\"Acronym\" href=\"https://en.wikipedia.org/wiki/Acronym\">acronym</a>. Since the acronym <em>FAQ</em> originated in textual media, its <a title=\"Pronunciation\" href=\"https://en.wikipedia.org/wiki/Pronunciation\">pronunciation</a> varies; \"F-A-Q\",<sup id=\"cite_ref-pron_1-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/FAQ#cite_note-pron-1\">[1]</a></sup><sup id=\"cite_ref-pron_1-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/FAQ#cite_note-pron-1\">[1]</a></sup> is commonly heard. Depending on usage, the term may refer specifically to a single frequently asked question, or to an assembled list of many questions and their answers. Web page designers often label a single list of questions as a \"FAQ\", such as on Google.com,<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/FAQ#cite_note-2\">[2]</a></sup> while using \"FAQs\" to denote multiple lists of questions such as on United States Treasury sites.<sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/FAQ#cite_note-3\">[3]</a></sup></p>', '', 'Rabu', '2016-06-22', '17:28:09', '1466591289.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '51', '0', '', '', '', 'N'), ('95', 'eka', 'About', 'content', 'about', 'N', 'N', '<div class=\"wrapper -cx-PRIVATE-SidebarLayout__contentWrapper\"><strong>Kevin Systrom</strong>(@kevin) is the CEO and co-founder of Instagram, a community of more than 300 million who capture and share the worlds moments on the service. He is responsible for the companys overall vision and strategy as well as day-to-day operations.\n<p>Since the beginning, Kevin has focused on simplicity and inspiring creativity through solving problems with thoughtful product design. As a result, Instagram has become the home for visual storytelling for everyone from celebrities, newsrooms and brands, to teens, musicians and anyone with a creative passion.</p>\n<p>Prior to founding Instagram, Kevin was part of the startup Odeo, which later became Twitter, and spent two years at Google working on products like Gmail and Google Reader. He graduated from Stanford University with a BS in Management Science & Engineering and serves on the boards of Walmart and KCRW.</p>\n<h3 id=\"mike-krieger-technical-lead-co-founder\">Mike Krieger (technical lead, co-founder)</h3>\n<p><strong>Mike Krieger</strong> (@mikeyk) is the technical lead and co-founder of Instagram, a global community that shares more than 60 million photos every day. As the head of engineering, Mike focuses on building products that bring out the creativity in all of us.</p>\n<p>A native of São Paulo, Brazil, Mike holds an MS in Symbolic Systems from Stanford University. Prior to founding Instagram, he worked at Meebo as a user experience designer and front-end engineer.</p>\n</div>', '', 'Rabu', '2016-06-22', '17:28:52', '1466591045.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '47', '0', '', '', '', 'N'), ('97', 'eka', 'Cara Meningkatkan Jangkauan Jaringan Wireless', 'article', 'cara-meningkatkan-jangkauan-jaringan-wireless', 'Y', 'N', '<p><em>Cara Meningkatkan Jangkauan Jaringan Wireless</em> sudah banyak kita jumpai dibeberapa site, namun mungkin belum membantu menguatkan jangkauan jaringan.Dalam situs <a href=\"http://jaringankomputer.org/\" target=\"_blank\">jaringan komputer</a> ini saya mencoba menyajikan bagaimana <strong>memperkuat jangkauan wireless</strong> yang lemot dengan beberapa trik agar jangkauan jaringan wireless dapat diperkuat.</p>\n<p>Memang sangat menjengkelkan ketika kita mendapati sinyal wireless yang sangat jelek, kadang terfikirkan untuk mengganti router wireless yang baru. Namun ada beberapa <strong>cara meningkatkan jangkauan jaringan wireless</strong> sebelum mencoba untuk menggantinya dengan wireless router yang baru.</p>', '', 'Rabu', '2016-06-22', '17:33:53', '1466591523.jpg', '', '', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('96', 'eka', 'Trik Cara Mempercepat koneksi Internet Dengan Merubah Bandwith Limit di Windows 7', 'article', 'trik-cara-mempercepat-koneksi-internet-dengan-merubah-bandwith-limit-di-windows-7', 'Y', 'N', '<p><strong>Mempercepat Koneksi Internet</strong> sepertinya topik yang selalu menarik untuk diperbincangkan, berbagai trik mempercepat koneksi internet baik menggunakan software mempercepat koneksi internet maupun perangkat keras mempercepat koneksi internet berupa booster dan antena penguat koneksi takkalah maraknya di tawarkan.</p>\n<p>Cara <strong>percepat koneksi internet</strong> dengan software tentulah tidak selalu aman buat PC kita karena melakukan perubahan pada registry dari sistem operasi, bukan hanya itu <em>software mempercepat koneksi internet</em> yang didapatkan gratis, selalu disisipi program hack dan virus sehingga selalu tidak aman untuk digunakan. Pada artikel ini saya berbagi sedikit pengalaman setting <span>percepat koneksi internet</span> dengan merubah bandwit pada sistem operasi Windows 7</p>\n<p>Windows menggunakan 20% bandwith Secara default untuk mengupdate sistemnya. Sebenarnya kita dapat memaksimalkannya dengan merubahh reservable bandwith dengan cara sebagai berikut:</p>', '', 'Rabu', '2016-06-22', '17:37:45', '1466591189.png', '', '', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('98', 'eka', 'Teknologi Dan Pengertian Modem GSM', 'articl