'', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('102', '', 'Ponsel Anyar LeEco: RAM 8 GB, Kamera 25 MP', 'article', 'ponsel-anyar-leeco:-ram-8-gb,-kamera-25-mp', 'Y', 'N', '<div class=\"date\"><br class=\"Apple-interchange-newline\">Kamis, 23/06/2016 05:16 WIB</div>\n<div class=\"clearfix pt15\"> </div>\n<div class=\"artikel\">\n<div class=\"banner_inside_article\">\n<div class=\"banner_reg cad_skyp\">\n<div id=\"beacon_bf0fb0385a\"><img src=\"http://newopenx.detik.com/delivery/lg.php?bannerid=25058&campaignid=3383&zoneid=181&loc=1&referer=http://inet.detik.com/read/2016/06/23/051657/3239933/317/ponsel-anyar-leeco-ram-8-gb-kamera-25-mp?i991101105&cb=bf0fb0385a\" alt=\"\" width=\"0\" height=\"0\"></div>\n</div>\n</div>\n</div>\n<div class=\"pic_artikel\"><img title=\"Ponsel Anyar LeEco: RAM 8 GB, Kamera 25 MP\" src=\"http://images.detik.com/visual/2016/06/23/36a43f4b-6a11-4770-973f-7aea67edb643.jpg?w=500&q=90\" alt=\"Ponsel Anyar LeEco: RAM 8 GB, Kamera 25 MP\">Foto: LeEco</div>\n<div class=\"text_detail\"><strong>Jakarta</strong> - Tak butuh waktu lama untuk LeEco merilis ponsel anyarnya. Setelah mengusung LeEco Le Max 2 pada April lalu, kini mereka siap merilis ponsel flegship baru.<br><br>LeEco pun telah merilis teaser di situs Weibo, di dalamnya memuat informasi jadwal peluncuran. Perusahaan asal China itu berencana merilis smartphone anyarnya pada 29 Juni mendatang di Shanghai, kemungkinan besar di ajang Mobile World Congress (MWC).<br><br>Sayangnya dalam teaser tersebut tidak ada sedikit pun soal spesifikasinya. Tapi menurut rumor, LeEco akan membekali dengan jeroan lebih tinggi ketimbang Le Max 2.<br><br>Ponsel ini akan memiliki dapur pacu Snapdragon 821 dan RAM 8 GB. Kecepatan prosesornya dijanjikan dapat didongkrak dari 2,15 GHz ke 2,5 GHz. <br>\n<table class=\"pic_artikel_sisip_table\" align=\"center\">\n<tbody>\n<tr>\n<td>\n<div class=\"pic_artikel_sisip\" align=\"center\">\n<div class=\"pic\"><img src=\"https://images.detik.com/community/media/visual/2016/06/23/474bb71b-c220-4449-be30-6eb60ec09cdf_43.jpg?w=480\" alt=\"\"></div>\n</div>\n</td>\n</tr>\n</tbody>\n</table>\n<br>Di bagian belakang, LeEco disebut-sebut menyematkan kamera berukuran cukup tinggi, yakni 25 megapixel. Tapi yang mencengangkan, harga ponsel ini bakal dibanderol terjangkau.<br><br>Dilansir dari <em>Gizmochina</em>, Kamis (23/6/2016), LeEco konon bakal melepas ponsel ini seharga 2.999 yuan atau sekitar Rp 6 juta. Melihat spesifikasi dan harga, rasanya ponsel ini cukup menarik untuk ditunggu kehadirannya. <strong>(afr/ash)</strong> </div>', '', 'Kamis', '2016-06-23', '08:38:16', '', '', '', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('106', 'eka', 'Informasi 2', 'info', 'informasi-2', 'Y', 'N', '<p><span>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui. Etiam rhoncus. Maecenas tempus, tellus eget condimentum rhoncus, sem quam semper libero, sit amet adipiscing sem neque sed ipsum. Nam quam nunc, blandit vel, luctus pulvinar, hendrerit id, lorem. Maecenas nec odio et ante tincidunt tempus. Donec vitae sapien ut libero venenatis faucibus. Nullam quis ante. Etiam sit amet orci eget eros faucibus tincidunt. Duis leo.