e-interchange-newline\">Rabu, 22/06/2016 20:07 WIB</div>\n<div class=\"clearfix pt15\"> </div>\n<div class=\"artikel\">\n<div class=\"banner_inside_article\">\n<div class=\"banner_reg cad_skyp\">\n<div id=\"beacon_e555e8796e\"><img src=\"http://newopenx.detik.com/delivery/lg.php?bannerid=15011&campaignid=4880&zoneid=181&loc=1&referer=http://inet.detik.com/read/2016/06/22/200714/3239833/328/ajak-operator-perangi-telkomsel-indosat-kena-cibir?&cb=e555e8796e\" alt=\"\" width=\"0\" height=\"0\"></div>\n</div>\n</div>\n</div>\n<div class=\"pic_artikel\"><img title=\"Ajak Operator Perangi Telkomsel, Indosat Kena Cibir\" src=\"http://images.detik.com/visual/2016/06/17/c8b72c2b-29fd-4e95-a201-d2bc94bdbbcd_169.jpg?w=500&q=90\" alt=\"Ajak Operator Perangi Telkomsel, Indosat Kena Cibir\">Foto: Internet</div>\n<div class=\"text_detail\"><strong>Jakarta</strong> - Seruan bos Indosat Ooredoo yang mengajak operator lain seperti XL Axiata, Hutchison 3 Indonesia, dan Smartfren Telecom untuk memerangi dominasi Telkomsel di luar Pulau Jawa mendapat cibiran keras. <br><br>Cibiran ini disampaikan Kamilov Sagala, mantan anggota komite Badan Regulasi Telekomunikasi Indonesia (BRTI) yang saat ini menjabat Ketua Lembaga Pengembangan dan Pemberdayaan Masyarakat Informasi (LPPMI).<br><br>\"Mengajak operator lain bersama Indosat bukanlah cara yang tepat justru merusak tatanan industri yang sudah mulai baik. Sangat tidak <em>educated</em> untuk menyelesaikan kondisi saat ini,\" sesalnya saat berbincang dengan <strong>detikINET</strong>, Rabu (22/6/2016).<br><br>Pernyataan untuk ikut memerangi Telkomsel diserukan oleh President Director & CEO Indosat Ooredoo, Alexander Rusli, karena dianggap terlalu mendominasi dan memonopoli pasar seluler di luar Jawa. <br><br>\"Saya minta kepada bos operator lainnya untuk ikut bersuara, jangan cuma berani ngomporin di belakang saja. Jangan takut untuk bicara, ini demi kepentingan bersama. Ayo kita <em>fight</em> habis-habisan untuk kepentingan pelanggan,\" ujarnya.<br><br>Dalam pertemuan terbatas kepada sejumlah media tadi malam, Alex juga menyatakan bahwa barrier interkoneksi sebaiknya dihilangkan dan operator diizinkan untuk berbagi jaringan aktif agar efisien.<br><br>Terkait hal tersebut, Kamilov berpendapat, jangan sampai ada anggapan dominasi pasar oleh Telkomsel dianggap tidak natural. \"Padahal mereka yang paling konsisten membangun jaringan di seluruh Indonesia.\" <br><br>\"Justru yang perlu dipertanyakan adalah mengapa operator yang menuntut keadilan selama ini tidak membangun, kemudian saat kalah kompetisi sekarang malah minta subsidi ke kompetitornya lewat penurunan tarif interkoneksi,\" paparnya lebih lanjut.<br><br>\"Mereka sudah tumpang tindih antara sebagai pemain atau regulator. Kampanye yang membandingkan secara langsung dengan kompetitor itu jelas salah di etika pariwara,\" lanjutnya lagi.<br><br>\"Soal isu monopoli, kalau memang ada sebaiknya lapor saja ke regulator. Kan di telekomunikasi ada BRTI dan persaingan usaha ada KPPU. Kenapa bikin gaduh dulu di media massa. Ini seperti menggiring opini publik,\" sesal Kamilov.<br><br>Ia pun berharap agar BRTI dapat melihat masalah ini secara lebih jernih dan menindak tegas pihak-pihak bermasalah dalam sengketa ini. \"Ini kalau saya lihat aksi Indosat seperti ingin mengambil ikan tetapi bikin kolam keruh. Isu monopoli di luar Jawa tak relevan, sama-sama punya lisensi seluler.\" <br><br>\"Bahkan di beberapa wilayah Indosat masuk duluan. Bedanya yang satu (Telkomsel) bangun terus, satunya (Indosat) sudah bangun tapi tidak dikembangkan, atau malah sebagian baru mulai gencar bangun. <br><br>\"Nah, yang baru masuk ingin ambil ikan tetapi bikin air yang jernih jadi keruh semua. Paling kasihan nanti pelanggan, mereka bertempur, kualitas layanan menjadi turun. Seharusnya pemerintah harus lebih tegas dalam mengawasi dan menindak operator yang tidak bangun jaringan,\" tegas Kamilov.<br><br>Senada dengan Kamilov, anggota Komisioner BRTI I Ketut Prihadi menyatakan bahwa posisi Telkomsel di luar Jawa bukanlah aksi monopoli karena semua operator diberi kesempatan yang sama untuk membangun jaringan dan menyediakan layanannya. <br><br>\"Jika sekarang hanya ada Telkomsel, hal ini bukan salah Telkomsel. Mungkin pertanyaannya adalah kenapa operator lain tidak mau membangun, apakah tidak mau atau tidak mampu?\" ucap Ketut saat dihubungi terpisah.<br><br>Operator pun diimbau jangan cuma menawarkan tarif murah kepada pelanggan. Tetapi juga dapat memperluas ekspansi jaringannya sehingga menjadi pilihan masyarakat di berbagai tempat. Hal ini penting dilakukan supaya di luar Jawa ada pilihan juga untuk pelanggan. <br><br>\"Untuk membangun backbone seluler memang diperlukan campur tangan Pemerintah atau BRTI sehingga penyedia backbone fiber optik di luar Jawa dapat menawarkan harga sewa yang kompetitif terhadap operator seluler yang butuh backbone tersebut,\" pungkasnya.</div>', '', 'Kamis', '2016-06-23', '08:37:22', '', '', '', '', 'D', '', '', '', 'Y', '0', '0', '0', '', '', '', 'N'), ('105', 'eka', 'Informasi 1', 'info', 'informasi-1', 'Y', 'N', '<p><span>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam ultricies nisi vel augue. Curabitur ullamcorper ultricies nisi. Nam eget dui. Etiam rhoncus. Maecenas tempus, tellu